INSERT INTO `barangay_tb` (`brgy_id`, `brgy_name`, `brgy_text`) VALUES
(2, 'Alfonso', 'Year of Foundation 1970\n\nPopulation: 6,697\nNo. of Households: 1,594\nBarangay Fiesta December 29-30\n\nPatron Saint San Tiago (Saint James)\n\nThe present Barangay of Alfonso used to be a sitio of Santiago.\nSometime in 1968, a group of its residents, led by the late Felix Llorante, Jr.\nand Rizalito Turla,banded themselves and petitioned higher authorities for\nthe independence of their sitio from the said matriz of Santiago.\n\nIn 1970, Barangay Alfonso was. created. An election was\nsubsequently held, with Mr. Felix Llorente,Jr. becoming the first Barangay\nCaptain. Other who became barangay captians includes Valeriano Canlas,\nRosendo Espiritu, Pedro Gamboa, Arceo Dayrit, and Ernesto Policarpio.\n\nThe barangay\'s appellate of Alfonso was in honor of Don Alfonso de\nLeon, who owned most of the tracts of land that used to compromise the\nplace. Old patronymics of the Barrio include the Llorante, Feliciano, de la\nCruz, Villapafia, Sotto, Dayrit, Amurao, and Perez families, among others.\n\nBarangay Alfonso is place of peace-loving, progress-minded and\nhospitable people. It is one of the most progressive barangay of our\ncommunity in the process, achieving the largest barangay of Concepcion in terms of income.\n\nWith a land area of 142.295 hectares of flat terrain, it is bounded on\nthe north by Brgy. Sta. Maria, on the east by Brgy. San Nicolas (Poblacion),\non the south by Brgys. Green Village and Santiago, and on the west by\n\nBrgy. Sto.Nifio.\nOf all barangays, it has the sole distinction where two public\ncemeteries and the three memorial parks are situated. Thus, when Daun \n(All Saints Day ) comes, major roads of Concepcion lead to this barangay.\n'),
(3, 'Balutu', 'Year of Foundation ca. 1853\nPopulation: 3,840\n\nNo. of Households:  903\nBarangay Fiesta March 25-26\n\nOther Names Paruao\n\nBalutu is the present official name of the barrio In the 1853 listing of the components\n of Magalang-Concepcion, there is known barrio as Paruao. \nThis could not yet be identified though an old barrio of\nwhich has been identified by the HDP but which is nonexisten\nand 1853 listings was that Balutu, believed to have been named after its\nNegrito chieftain Balbalu to. Some old inhabitants of the barrio, however,\nattribute the term as a type of a banca (boat) which used to ply the river in\nthe olden times. It is interesting to cite here that there is also a barrio called\nBalbaloto in Victoria, Tarlac and its agreed provenance was that of the said\nbanca. At present , what the people know of PARUAO is Parua River (the\nConcepcion portion of the Bamban-Sacobia River.)\n\nThe sitios within the jurisdiction of Balutu around 1950s included\nLilibangan, Calius, Panalicsican, Cutcut, Capaya, Tarac, Tangan-tangan\nand Pabungan. The first three would be achieving their status in the\nsucceeding years.\n\nit was said that when the original settlers, presumably the Negritos,\nabandoned the place, almost every lot was owned by Cortes Family. The\ncomplete list of CABEZAS DE BARANGAY from that time could not be\nprovided but it is included Felix Cortes, Angel Yumul, Teodoro David,\nMarciano Liwanag, Demetrio Canlas, Marciano Garcia, Roman Tua, and\nJuan Punzalan.\n\nWay back during the revolutionaries bravely met the Spaniards at\nPatbungan and made the place a battle field. With the few arms of the\nKatipuneros consisting mostly of bolos, they were able to gain victory. It\nwas not long after that the Americans came and were welcomed by the.\nbarrio folks, introducing what we now call as the peace time. During the\nJapanese Occupation many people of Balutu suffered. Lives of suspected\npersons ruthlessly taken without any investigation whatsoever. There was\none in the barrio who was Killed for being suspected as GUERILLA.\n'),
(5, 'Cafe', '\nYear of Foundation: ca. 1950s\nPopulation: 2,400\nNo. of Households: 567\nBarangay Fiesta 3rd Sunday of January\n\nBarangay Cafe occupies a land area of 377.8 hectares, situated on the eastern part of the municipality of Concepcion. It is around six (6) kilometers away from the town proper. It is bounded on the east by Tacde, a sitio of Brgy. Sta. Cruz, on the north by Matalusad, a sitio of Sto. Rosario, on the south by Brgy. Culatingan and that of Lucong River, which also serves as Cafs boundary with that of Brgy. Lilibangan.\nCafes agricultural lands are naturally fertile, though must be supplemented by the people\'s own irrigation pumps especially during summer. Some portions of the barangay were effected by lahar during eruption of Mount Pinatubo in 1991. Rice farming is still the major industry, aside from fishing, duck raising, poultry and swine production. A number of the population is engaged in various modes of public transport.\nCafe is basically a recent barangay, inasmuch as it was still nonexistent as late as 1948, presumably as a sitio of Barangay of Santa Cruz. Old folks used to say that as early as the 18th century, the place was already abound with vegetation that turned out to be coffee trees. It is possible that the area was devoted in early times for coffee productin, meriting its present name. Original settlers of Caf include the Manalungsung, Salas Dimatulac, Mendoza, Torres and Guevarra families, among others.\n22 Jul 2022\n'),
(6, 'Calius Gueco', '\nPopulations: 1,164\nNo of Households: 247\nBarangay Fiesta	1st Sunday of March\n\n	The official name of the barangay is Calius Gueco. It was derived from a rigid, densely branched tree found in thickets in low and medium altitudes,especially in regions with long dry seasons and also known as ampas in Kapampangan (streblus asper) and a landed patronymic of the area, the Gueco family. It is bounded by the barangay of San Isidro on the west, Panalicsican  on the east, and the Magalang barangay of Balitucan on the south. Calius Gueco used to be a sitio of Balutu.\n'),
(7, 'Caluluan', 'Year of Foundatio:n ca. 1896\nPopulation: 4,045\nNo. of Households: 1,083\nBarangay Fiesta: May 14-15\nPatron Saint San Isidro de Labrador\n\n\n	The barrio is officially known as Caluluan. It was formerly called Caliwaluwan which was derived from the fresh water fish called liwalu (archer) which was abundant in the creek, interestingly called also as \'Sapang Caliwaluwan\' (Caliwaluwan Creek). The people had the difficulty of saying Caliwaluwan, so they just shortened and straightened the word to Caluluan. In 1950s, when the HDP was prepared, the sitios within the territorial jurisdiction of Caluluan included Parulung, Coral Cambing (Pando), Maranac, Malapatan, Dungan, Asong, and Malilung. Two of them, Parulung and Coaral Cambing, are now independent barangays.\nThe barrio, though actual record could not be cited yet, was said to have been established in the later part of 1896. Long before that date llocano settlers from Zambales and the llocos have already migrated to the place but they were so scattered that not until about the beginning of the 1900s when they begun to close in Caluluan, which was still then a mere sitio of Bantug, which by then was still a barrio of Concepcion. Tales had it that if not for an incident wherein on time a guard was late in his post (Anacleto Diaz), Caluluan would have not become a separate barrio. Beause this guard was severely punished by the Spaniards and the Filipino officials so that the following day the people from Caliwaluwan decided to stand by themselves and make their own barrio. From then, their place or settlement was called Barrio Caliwaluwan which was later better known as barrio Caluluan.\nOriginal settlers of Caluluan include the Agustin, the Bayagos, Angeles, Corpus, Vinuya, Narciso, Maranion, Ramirez, and Rozaldo families. All these families were llocanos who originated from Zambales and the Ilocos Regions. Early tenements del barrio included Sr. Lenon Agustin (1905-1906), Sr. Tomas Mirafelix (1907-1910), Sr.Luis Atanacio (1911),Angel Narciso, Apolonio Pablo, Estanislao Galang, Segundo Galang, Victor Reyes, Diasdado Castro, Basilio Magcalas, Alfonso Mallari, Alejandro Bautista, Gonzalo Timbal (1942-1945), Gonzalo Mejia.\n\n'),
(8, 'Castillo', 'Year of Foundation ca. 1960s\nPopulation: 2,745\nNo. of Households: 661\nBarangay Fiesta March 9-10\n\n\n	The barangay connotes a very interesting toponym. Castillo from the Spanish \'castle\' is presently a southern barrio of Concepcion on the Nueva Ecija border. An account mentioned that it was so called as such since it was the place for the timalogs (or those who were then fleeing from the law). It could have been also derived from cestilo\' or alaula, a native fishcot thus suggestive of its revering setting, washed by the Rio Chico de Pampanga. It is approximately 8 kilometers away from the Poblacion, with an area of 1,147.62 hectares.\nThe name, which is the most plausible, is also remindful of the primeval Tarlac, which in 1953 was actually started as a fort (Castillo) to guard other provinces from the depredations of Negritos, the tulisanes and the remontados. People of the place remember the initial site of the barangay as located in an elevated terrain, in a vanity often frequented by floods due to the water of Chico. Due to frequent floods, inhabitants decide to abandon the old site, relocating northward in what is now known as \'New Castillo\nThe barangay is among the recent ones of the town, created around 1960s. It was a former sitio of Mango. Majority of the people are engaged in rice farming; secondary crops include eggplant, mongo, yellow corn, sweet corn, and water melon. Other means of livelihood include fishing and livestock production, including swine, cattle, and goat.'),
(9, 'Corazon De Jesus', 'Other Name/s Darabulbul\nYear of Foundation: ca. 1934\nPopulation: 1,837\nNo. of Households: 427\nBarangay Fiesta February 10-11\nPatron Saint Our Lady of Lourdes, Sacred Heart of Jesus.\n\n\n	The present name of the barangay is Corazon de Jesus. Its former name was Darabulbul, which was already listed among the early barrios of Magalang since 1853. Rather than the provenance of the often recited \'the aunt\'s pubic hair\' story, Darabulbul actually meant in old Kapampangan as the loud, bubbling sound of a river, signifying that the place as a delta.\nAnother early name of the barangay was San Miguel, after its patron saint. In the HDP, it was mentioned that this was done in 1934. This was an area known as Bayung Baryu (New Barrio) under the conglomerate San Miguel and consisting of five big barrios. (darabulbul, Pitabunan, Talimundoc, Tinang and Mabilog.) recomposed during the American period. It could have been earlier. The barrio of San Miguel was already listed as a town of Concepcion in the census of 1903.\nEarly barrio officials included Anacleto Cortez, Pablo Libunao, and Hugo Tuazon. Since 1964, San Miguewl-Darabulbul was officially renamed Coraon de Jesus, in honor of sacred heart, the patron of a religious mission founded by the Religious of the Virgin Mary (RVM sister) in 1939 and the parish, among the first to be created in the municipality.\n'),
(10, 'Culatingan', 'Year of Foundation ca. 1950s\nPopulation: 3,163\nNo. of Households:  659\nBarangay Fiesta 2nd Sunday of January\n\n\n	The present official name of the barrio is Culatigan. The name was said to have been taken a tall tree species known as Culatigan that used to thrive in the place. It has been a sitio Sta. Monica since its establishment. According to the early settlers, the barrio was established as early as 1914, but this could not be verified as it was not included among early listings\'.\nThe original families were the Reyes, dela Cruz, Ortiz Luis, Perez, Silvestres, and many others whose names cannot be recalled. There was no tenientes Del barrio when it was still within the territorial jurisdiction of the Sta. Monica, but when the people gradually increased, a barrio lieutenant had been duly appointed.\nThe big house owned by the Ortiz Luis Family and the other large homes had been destroyed or either burned during the Japanese Occupation. Since 1914, the barrio has been settled. The lands had been utilized for field crops.\n'),
(11, 'Dungan', 'Year of Foundation\nPopulation:970\nNo. of Households: 224\nBarangay Fiesta February 24-25\n\n\n	Barangay Dungan is around 4 kilometers away from the poblacion of Concepcion. serving as a border to the town of Bamban. it is bounded by the Parua River on the west. Barangay San Francisco on the east, and on the north by Bangcu, a barangay of Bamban. Dungan is a Kapampangan term for river bank, suggestive of the geographical setting of the barangay . like other barangays of Concepcion, farming is also a mojor source income for the people. The Department of Agriculture and other agencies have established  various  forms  of cooperatives to augment the income of the people\nThe barangay used to be a sitio of San Francisco.'),
(12, 'Dutung-A- Matas', 'Other Name Jefmin\nYear of Foundation 1995\nPopulation 3,831\nNo. of Households: 972\nBarangay Fiesta January 5-6\n\n\n	Dutung a Matas is the official name of the barrio. It is popularly known also as Jefmin Village. It is among the oldest sitios of Matondo, or the present barrio of Sto. Nio, since the Spanish times. Located on the western part of Concepcion, Jefmin is bounded by Brgy. Sto. Nio on the north, brgy. Alfonso on the east, Brgy. Santiago on the south, and Brgy. San juan on the west.\n\n	During the early days, Dutung A Matas was covered with thick forest and big tall trees, thus meriting its toponym. It was a good hunting place for some people, because of wild pigs, deer and birds. Some people used it as sanctuary or a hiding place, especially those people wanted from Spanish and American authorities during the colonial period. Among them was the great revolutionary of Concepcion, General Servillano Aquino.\n\n	The first inhabitants of the place are the Zambals or Negritos, originating from the Zambales Mountains around 1791. In mid 18th century, when a big flood devastated the former town of Magalang-Concepcion from its former place in San Bartolome, people began to migrating to Sto. Nio, so they began clearing the place, with the exception of the tall and sturdy trees or dutung a matas. Among the early settlers were the Lindo, Lacsamana, Punzalan, Pangilinan and Muoz families.\n\n	The establishment of Dutung A Matas as an independent barrio was in 1955, from its matrix of Sto. Nio. There was a rapid growth of its population, because a subdivition, Jefmin Village, was opened by Mr. Jesus T. Pineda during the 1960\'s. The 185th Philippine Constabulary Command was also stationed at Jefmin Village for some time, providing in the maintenance of peace and order in Concepcion, Capas, Bamban and Lapaz. Among the early tenientes del barrio and barrio captains who served Dutung A Matas include Basilio Muoz, Emilio Mendoza, Leodigario Sotto and Nardo lacsamana. It was said that in 1982, a barrio ordinance decided to rename Dutung A Matas As Jefmin, due to the absence of tall trees that used to thrive in the areas. It was also a token of gratitude by the people to the Late Jesus T. Pineda and family who helped in the improvement of the community. A big mango orchard can still be found in Jefmin, with an area of eighteen hectares (18) hectares. A ware house building of the National Food Authority is also located in the area, among the biggest in the whole province.'),
(13, 'Green Village', 'Other names/s Lalam Cuayan\nYear of Foundation ?\nPopulation: 2,293\nNo. of Households: 504\nBarangay Fiesta June 26-27\n\n\n	The present official name of the barrio is Green Village. Formerly, it was a part or sitio of Santiago. In the earlier times, the area used to be an hacienda owned by the Aquino\'s. It was described then as being verdant, canopied by bamboos, thus being referred to as \'Lalam Cuayan\' (under the bamboos). Original settlers include the Dizon, Baluyut and Yumul families.\nGreen Village is only about a half kilometer away from the poblacion, thus characterized as among the urbanized communities of Concepcion. However, a big number of its inhabitants is still engaged in farming. The average yield of production ranges from 75-80 canvas per hectare. The area is naturally fertile, and during the dry months, Farmers tend to intercrop green corn, mongo, and vegetables. Aside from farming, they also venture on backyard poultry, swine production, and cattle and goat-raising. Farmers also own fishponds, wherein it provides cheap source of protein for their family.\n'),
(14, 'Lilibangan', 'Year of Foundation ?\nPopulation: 1,269\nNo. of Households: 255\nBarangay Fiesta March 16-17\n\n\n	The official name of the barangay is Lilibangan. It is approximately 6.5 kilometers from the poblacion of Concepcion. It lies on the eastern part of the town, bordered by the Parua River and Brgy. Balutu on the south, Lucung River on the north and Brgy. Magao on the east. The barangay covers an area of 246.24 hectares. Its used to be a sitio of Magao.\nPalay is the crop wich is practically planned on whole rice land area during the wet and dry season. The absence of irrigation facilities leaves the area dependent on pumps. The second major crops are corn, watermelon, and sweet potatoes, which are planted mostly during the dry season. Farming, fishing and livestock production are major source of livelihood in the community, thus the barangay meriting its name of \'Lilibangan\' (a trough, or where animals are fed). Swine, cattle and duckraising are also done in some backyards.'),
(15, 'Mabilog', 'Already listed in 1842, 1903\nYear of Foundation\nPopulation: 2,411\nNo. of Households:  602\n\nBarangay Fiesta March 29-30\nPatron Saint Our Lady of Immaculate Concepcion\n\n	The official name of the barrio is Mabilog, a Kapampangan term for \'circle\'. Most of the towns and barrios in the Philippines got their names in honor of our great men, women and saints but Mabilog is so different.\nLike many other places of the Philippines, Mabilog was once a thick forest which was inhabited by wild animals prior to its settlement. Allured by the presence of those wild animals in abundance, a group of men from Concepcion, Tarlac, came hunting to this place. While hunting, they found out that there were plenty of \'buho\', an excellent material in making sawali. Later, other groups of sawali workers came to this place and brought with them their families. This marks the humble beginning of its settlement. Among the earliest setters were Nuqui, Cabilangan, Paras and Nunag families. For convenience and for better protection against robbers and wild animals, they group themselves in the form of a circle. The males slept in the guard house were located in the middle of the neighborhood. This spectacular formation of houses for many years registered in the minds of people, particularly the visitors and passers-by, Thus, the term \'Mabilog\' always came in mind, eventually becoming even the official name of the barangay.\nThe date of establishment is placed at 1924, though it cannot be verified as it was not included among the barrios of Concepcion until 1948. As part of the Hacienda Luisita, however, the place was also known as \'Pasajes\' or \"passages\" and it was already mentioned in earlier accounts of TABACALERA, the previous owner of the Hacienda.\nAmong the early tenientes de barrio included Fortunato Galang, Eusebio Bacani, Claudio Nunag, Valentin Lopez, Alejandro Valencia, and Pastor Lopez\n'),
(16, 'Magao', 'Year of Foundation already listed in 1842, 1903\nPopulation: 1,598\nNo. of Households: 415\nBarangay Fiesta March 29-30\n\n\n	The present official name of the barangay is Magao. A document attested that this particular barrio was actually under the jurisdiction of La Paz in 1842.3 Its provenance, according to the HDP, was given by Ilocanos, which means \"not able\" Its establishment was placed by the same document as 1904, probably in references to the Philippine census made that year, though it could have been earlier. When the HDP was prepared the sitios of Magao, included Lilibangan, Camatisan, Castillio, Peralta, Caf, Calamanti and Cap-Cap. A number of them eventually achieved their independent barangay status.\nAmong the early tenientes del barrio included Don Manuel Reyes, Don Macario de Ocampo, Fermin Galvez, Miguel Manabat, Simeon Manliclic, Gregorio Pangalinan, Cresencio Lobo, Valeriano Mutuc, Dionicio Mejia and Benedicto Lobo.\n'),
(17, 'Malupa', 'Year of Foundation ?\nPopulation:1,391\nNo. of Households: 311\nBarangay Fiesta May 14-15\nPatron Saint San Isidro de Labrador\n\n\n	The official name of the barangay is Malupa. Together with the sitio of Bangcal, it used to be a sitio of Brgy. San Martin. A prominent head of the barrio was Mr. Vitaliano Dayrit who, together with his secretary, Mr. Angel Ramos, petitioned for the separation of Malupa as an independent barangay. An increase in its population merited the fulfillment of the petition, with Malupa ang Bangcal being separated from San Martin. The oldest clans of Malupa include the Gomez, Ramos, Mallari, Pallasigue, nad Lising families.\n'),
(18, 'Minane', 'Other Name/s Rose Park\nYear of Foundation ca 1853\nPopulatio: 2,604\nNo of Households: 724\nBarangay Fiesta February 10-11\n\n\n	The present official name of the barangay is Minane. Minane, in Pampange, means \"infested by white \'ane\' or termites.\" During the early days, there were only very houses built in this place, because people are afraid that they might be infested by termites. The HDP mentioned that it was once a sittio of San Francisco, but basing from the 1853 source, it could be indicated that it was actually an old barrio (actually. San Francisco was still nonexistent by this time). Minane is among the more progressive barangays of Concepcion Minane is bounded by Brgy. Sta. Rita in the east, Brgy. San Francisco in the west, and the poblacion in the north. Since the early days, Minane was an agricultural land owned by the late Agapito Aquino. Being adjacent to the present poblacion and opposite a creek known as Sapang Suartel, old people called it Cangatba (across the river). Prior to WWII, there were only 31 private houses built in Minane. The original settlers include the Tiqui, Bondoc, Madrid, Evangelista, Gutierez, Dizon, Bermudo, Tapang, Patiu, Tolentino, Santos, Gomez, Magtoto, Navarro, Calma, Dayrit, Sison, Maniego, Dalusong., and Balatbat Families. The houses during those days were built along the creek. On the southern portion of the road was a sugarcane field and rice plantations. When the Japanese invaded the Philippines in 1942, people in the furthest barrios evacuated to this place of Minane to make themselves safety and free from being suspected as Hukbalahaps. The people did not suffer or experience hunger, because they were industrious. Farmers planted vegetables, camotes, corns, cassava, and rice in the fields as well as in their backyards. Fishing was another livelihood of the people because Minane is along the creek.\n\n	After World War II.  the public road was repaired by the provincial government from the pork barrel funds of the national government. The houses along the creek were transferred along the new road in 1950. In 1958 some of the agricultural lands were subdivided by Engineer Augusto J Valdes and Anatalia Aquino Valdes. This was the birth of the \'Rose Park Subdivision which is only 200 meters away from Concepcion Public Market. Two years later another subdivision was approved and opened, the Fadiz subdivision_ In 1970. the GSIS Teachers Village and the Castro-Aquino subdivision were also opened. There are now four subdivisions in Barrio Minane which are geographically divide into for puroks or sitios of the Baranggay.\nAmong the early tenientes del barrio and baranggay captians of Minane included Apolinario  Lansangan,  Pablo Antonio,  Leonardo  Santos.  and Cenon Gomez.\n'),
(19, 'Panalicsican', 'Year of Foundation ca. 1853\nPopulation:  1,329\nNo. of Households: 266\nBarangay Fiesta March 18-19\n\n\n	The official name of barangay is Panalicsican. This barrio was said to have been founded by the late Don Cayetano Rivera of Magalang, Pampanga, a noted figure during the Philippine Revolution and a signatory of the Pact of Biak na-Bato in 1897. The first settlers of the place originated from Magalang, Puntang Bulu (old name of San Bartolome), Concepcion and Mabalacat (Pampanga). The barrio was already listed actually in 1853, as a barrio of the old Magalang. It was derived from saliksik or \"penetrated\" signifying that its pioneering settlers had to permeate a forested area and clear it to be able to start their settlement. The HDP, however, lists its creation only by the 1900s; as an offshoot of the migration of people from Concepcion, Magalang, and Mabalacat. Some accounts mentioned that it used to be a sitio of Magao, though a document attested that this particular barrio was actually under the jurisdiction of La Paz in 1842.4. The first original families were the Dungca, Sarmiento, Dayrit, Pamintuan, Macalino, and Galang. Early tenientes del barrio included Juan Dungca, Narciso Pamintuan, Celestino Macalino, Felix Dayrit, Lazaro Pineda, Federico Mendoza, Panteleon Pamintuan, and Patricio Lagman.\n\n'),
(20, 'Pando', 'Other Name/s Coral cambing\nYear of Foundation ?\nPopulation: 2,175\nNo. of Households: 563\nBarangay Fiesta March 28-29\n\n\n	A former sitio of Caluluan the barangay is known for its two appellate, Coral Cambing (goat ranch) and Pando. It used to be the place where the goats of a Spaniards, by the name of Martinez, where herded. Coral Cambing was established around 1926, though it cannot be vouched. It was around 1960s that it became an independent barangay from its matrix of Caluluan. The original families were the Dungcas and Solimans. Early tenientes del barrio included Irineo Dungca, Jose Lumba, Francisco Maalac, Tomas Carreon, Guillermo Santos, Pedro Amurao, Lorenzo Maalac, and Emiliano Pagquil.\n\n'),
(21, 'Parang', 'Year of Foundation ?\nPopulation:3,109\nNo. of Households: 684\nBarangay Fiesta January 19-20\nPatron Saint San Sebastian\n\n\n	The official name of the barrio is Parang, also known as San Sebastian, its patron saint. Situated within the premises of the Hacienda Luisita, it! used to be a thickly-forested area frequented by wild animals. A river, Sapang Bulu, was known to have both abundant fishes and clear water.\nWith rice-fields dominating the scenery of the barangay, it was thus apt that it was called Parang, a Philippine term for the said terrain. There were those who believed that the barangay was named after a bird frequenting the area, the \'parang-parang Prominent Spaniards of Tabacalera who used to manage (\'encargados\') the area included Sr. Jose Mendrez, Sr. Peps (also known as \'Artificial Foot\') and Sr. Pedro Puno, who married a Filipina by the name of Belen Capulong, a native of Pampanga.\nEarly tenientes del barrio included Alberto Balatbat, Arquelino Salangsang. Cornelio Quiambao, Aquilino Arceo, Modesto Lumba, and Amando David. Subsequent barangay captains of Parang included Manuel Quizon, Jose Macaspac, Enrique Cunanan, Dominador Castillo, Francisco A. Sigua, Rey Nemis, and Francisco A. Sigua\n'),
(22, 'Parulung', 'Year of Foundation 1957\nPopulation: 1,709\nNo. of Households : 349\nBarangay Fiesta May 14-15\nPatron Saint San Isidro de Labrador\n\n\n	Parulung, the official name of the barangay, used to be a sitio of Brgy. Caluluan, ls within the territorial jurisdiction of the Brgy. Caluluan. Parulung, which means \"a rolling terrain,\" is located on the southwestern portion of the said barrio of Caluluan. Its establishment as an independent barrio was placed around 1957, during the incumbency of the late Sen. Benigno \"Ninoy Aquino Jr. as the mayor of Concepcion.\nSituated around 11 kilometers away from the poblacion of Concepcion, major crops of the area include rice and sugar cane. Early settlers include the Sotto, Perez, Pineda, and Cruz families.\n'),
(23, 'Pitabunan', 'Year of Foundation ca. 1853\nPopulation: 2,596\nNo. of Households: 611\nBarangay Fiesta May 7-8\nPatron Saint San Miguel de Arcangel\n\n\n	According to the HDP, when a flood swept the town of Concepcion in the 1860s and the inhabitants decided to look for a higher place like Magalang and Sto. Nio, Pitabunan was still part of Sto. Nio. Eight years later, the people under the leadership of Cabesa Candido Dizon built a chapel for the patron Saint San Miguel and sine then stood as a separate barrio from Sto. Nio and named after the patron saint, San Miguel Arcangel. An 1853 document however already listed Pitabunan as among the 35 barrios of the former town of Magalang-Concepcion\nPitabunan, from tabun or reclaimed land (from Spanish \'terraplane\'), was so-called because its inhabitants always reclaimed their land which was annually inundated by the floods caused by the Parua River.\nDuring the Spanish period, tenientes del barrio included the Candido Dizon, who owned vast tracts of land and who headed the place from 17711777, Macario Mandal (1877-1880), Diego Castro, (1880-1883), Meliton Aquino, (1883-1890), and a certain Buenaventura, (1890-1899).\nDuring the Spanish period, tenientes del barrio included the said Candido Dizon, who owned vast tracts of land and who headed the place from 17711777, Macario Mandal (1877-1880), Diego Castro, (1880-1883), Meliton Aquino, (1883-1890), and a certain Beunaventura, (1890-1899).\nDuring the American Regime, the tenientes del barrio included Ludovico Isais (1899-1902), Modesto Isais (1902-1905), Laureano Rodriguez (19051911), Ancieto Rodriguez (1911-1914), Buenaventura Maalang (19941920), Pedro Cabilang (1920-1929), Pedro Aliling (1929-1938), Santiago Magcalas (1938-1941), Cayetano Dizon (1941-1945), Dominador Aquino (1945-1948), Rufina Santiago (1948-1951), and Lorenzo Mungcal (1951)'),
(24, 'San Agustin', 'Other name/s Garlit, Murcia\nYear of Foundation ca. 1590s\nPopulation: 5,442\nNo. of Households: 1,238\nBarangay Fiesta August 27-28\n\n\n	The present name of the barrio is San Agustin. It was among the first barrios of Concepcion, already listed as early as 1950s. It was then known as Garlit, which is believed to be of Negrito provenance. In\nGaralita, ampong Pamisulatmap Kapampangn (kapampangan Grammar and Orthography) there is a term for garlit, i.e, apostrophe or the (\') symbol used to substitute an omission of a letter in a word .5. It mean, in politicogeographical parlance, as a detachment from the main territory (e.g., the transformation of a sitio to a barrio), An Augustinian account placed its foundation in 1755, through the intercession of Fray Sebastian Morono, O.S.A.\n\n	The popular name, both present and past, of the barangay is Murcia. This name has no meaning nor was it derived from any other word. It was just named after a ton in Spain where most of the Spaniards who settled in this barrio came from. At this time the patron saint was St. remedies which was later changed to St. Augustin. The change was due to the fact that the chapel wherein St. Agustin was housed in a nearby barrio was destroyed. The people had to transfer his image to the chapel in Murcia and housed it with St.Remedios. which was later changed to St. Agustin. The change was due to the fact that the chapel wherin St. Agustin was housed in a nearby barrio was destroyed. The people had to transfer his image to the chapel in Murcia and housedit with St. Remedios.\n\n	Later the people believed that St. Agustin is more miraculous than St. Remedios, so that they preferred having him as the patron saint of the barrio. Ever since that time the barrio was named San Agustin in honor of the patron saint now. However, the people celebrate the feast days of these two saints.\nIn 1888, Murcia, together with the barrios of Bucsit, San Juan and San Miguel (of Tarlac ) became an independent pueblo from Concepcion. The sitios included within the territorial jurisdiction of the barrio were Balango, Dalayap and Burot. Later on, however, during the early part of the American rule, the sitio of Burot was separated from the others and became a barrio, it present status. Now the barrio of San Agustin is composed only of Balango and dalayap.\nThe original inhabitants of the place were some Negritos from the Zambales mountains and were later replaced by the families of Andres, Fausto and Vicente dela Cruz, the Quiambao, and Soliman families.\nThe first teniente del barrio was Esteban Guevarra and was succeeded by Celedonio Bognot. Then came Salvador Camaya who was succeeded by Alfonso Quiambao, later by Teodoro Mallari.\nDuring the Spanish rule two big stores were established in this barrio, owned by Lucia Basco and a sister. There were also Chinese stores but these did not last long because they were soon replaced by small stores owned by Filipino retailers.\nDuring the Spanish regime it was proposed that this barrio should be made a town and so a chapel, where people could worship God, was built, a garrison or \"cuartel\" where the civil guards performed their duties was established, and a small school was also built. There was also a railroad station built in Burot. But when the Spanish American war broke out in which the Americans emerged victorious, all these buildings were demolished\nIn order to have a firmer control of the people and enhance their unity, the Spanish government organized the families into a barangay under a cabeza or a \"Captain.\" The first capitan appointed was Pablo Quiambao who was, upon his death, succeeded by Capitan Artemio Soliman. The next barangay officer who succeeded Capitan Soliman was Presidente Timoteo Saganara.\nUnder the American rule, the title of the barrio head was no longer retained as \'Capitan\' but was changed to \"Teniente del Barrio\" or barrio lieutenant\n\n	The people became interested in education and so a primary school was established. The present school building was purchased by Don Gonzalo Aquino, brother of the late Don Benigno S. Aquino, from the San Juan family and donated it to the school. The school site was also donated by the Quiambaos. It is indeed worthwhile mentioning that the late Benigno S. Aquino and other prominent men obtained their primary education in this school.\nDuring the early years of American regime, around 1903, Murcia was reverted as a barrio of Concepcion\n'),
(25, 'San Antonio', 'Year of Foundation already listed in 1903\nPopulation: 2,873\nNo. of Households: 681\nBarangay Fiesta June 12-13 \nPatron Saint San Antonio de Padua\n\n\n	The present and popular name of this barrio ls San Antonio. It was named after the Patron Saint of the barrio San Antonio de Padua. The sitios within the jurisdiction of this barrio are: Balas Lacid and Balas Gueco. The place of those two sitios is sandy that is why the Bales is used meaning sand. Because of their similarity in names the people found difficulty in identifying one from the ather. They remedied this by adding either the name or surname of the landlord to the word Balas. Hence, one sitio is called Balas Lacio and the other Balas Gueco. The founding of this barrio dated back during the Spanish regime. The Founders were the Malonzo Lacsamana, and the Punsalang Families. The persons who hold the position as barrio tenientes (Barrio Lieutenants) from the date of its establishment included Juan Lacsamana, Bartolome Alcantara, Alberto Narciso, Leon Guevarra, Alfonso Salas, Julian Guiao, Quintin Guevarra, Maximino Javier, and Leonardo Pineda.'),
(26, 'San Bartolome', 'Other names Puntung Bulu, Balen a Melacuan\nYear of Foundation 1865 (as a barrio)\nPopulation: 2,005\nNo. of Households: 441\nBarangay Fiesta August 23-24\nPatron Saint San Bartolome Apostol\n\n\n	The present official name of the barrio is San Bartolome. In 1950s, when the HDP was prepared, the sitios included within the territorial jurisdiction of this barrio are Dela Rosa Division, Angko, and Tangantangan. Having been the site of former town of Magalang-Concepcion since the 17th century, the barrio was said to have been re-established as a barrio in 1865 when most of the inhabitants abandoned the place. The original families were those of Captain Baltazar Dizon and Cabeza Jose Lacsamana\nThe following were tenientes del barrio from the earliest times: Cabeza Jose Lacsamana, Cosme Manalo, Perfecto delos Reyes, Daniel Capunu, Victorino dela Cruz, Isidro Bulandi, Jose Mallari, Artemio Paras, Silivino Santos, and Zoilo Lacson.\nDuring the Spanish period, San Bartolome was thickly populated. But misfortunes came. A typhoon blasted down most of the houses, trees were uprooted and the river near the barrio overflowed its banks, and washed away the stones of the old church. From that time after the calamity happened, people evacuated to a place now called \"Magalang\". The people began reestablish their settlement thereat. Now the barrio San Bartolome is called \"Balen a Melacuan\".\nThere was a big church in San Bartolome during the Spanish occupation but it was ruined. There was also a big house which was also used as headquarters of the Katipunan which headed by General Francisco Macabulos and General Servillano Aquino. The house was ruined by the Spaniards but the men of General Macabulos escaped.\nIt was during the Japanese Occupation that the Hukbalahaps made this barrio as heasquaters leading to Mt. Arayat. There were frequent encounters between the Japanese and the Huks that the poor civilians were sometimes involved many persons were killed without due process of law.\n'),
(27, 'San Francisco', 'Other names Talimunduk\nYear of Foundation aiready listed in 1903\nPopulation: 6,332\nNo. of Households: 1,591\nBarangay Fiesta October 3-4\n\n\n	The present official name of the barrio is San Francisco, San Francisco is popularly called Talimundoc, derived from the words \"ala and bundok.\nit was believed that this place was formerly an elevated piece of land\nits territorial jurisdiction includes some sitios. These sitios are Dawe Macangcong, Minane and Buca.\nSan Francisco is believed to have been established during the early part of the Spanish regime. It was founded by a person called isoong Barindi of the Santos Family. Early tenientes del barrio included. Secio Datu, Lalio Miiciat. Esteban Guttierez Ponciano Santos, Juan Magsilang. Dalimico Gutierez Vicente Santos, Dacio Dayrit. Alejandro Guzman, Catu Manut, Tiago Baluyut. Marcos Hipolito, Alberto Tapnio and Juan Vergara.\nAccording to the old story of the barrio, San Francisco was mere forest covered by thick, sturdy trees. This forest was under the jurisdiction of the old barrio of San Roque (Telabanca) and managed by a person calied isoong Barindi. When a strong flood swept many houses in San Roque, people transforming it as a prosperous settlement. With the death of spong Barindi, they have chosen San Francisco as their patron Saint in honor of the old man.'),
(28, 'San Isidro', 'Other names Almendras\nYear of Foundation already listed in 1700s /1903 \nPopulation: 2,947\nNo. of Households: 633\nBarangay Fiesta May 14-15\nPatron Saint San Isidro Labrador\n\n\n	Barangay San Isidro is bounded by Balutu on the north, the town of Magalang on the south, Panalicsican on the east and San Bartolome an the west. It is about 8 kilometers away from the poblacion of Concepcion\nThe barangay occupies a land area of 390.0 hectares. largely devoted to farming. Farmers plant rice for main crop and com both green and yellow) for 1 and 3rd crap. San Isidro is considered as the corn belt of the municipality, with the largest area devoted to the cereal\n	The barangay is also commonly known as Almendras. It is divided into three sitios, namely Apunan, Biabas and Bernarie. During the Spanish time, the area was thickly covered with trees known as Almendras. When settiers came, they cut the trees, cleaned the area and settled permanently. They called the place Almendras after the name of those trees. According to Spanish historians like Font and Cavada, Magalang was founded in 1605, in an area known as Macapsa among the barrios Almendras, Malabug and Sabanang Tugui. This could have been Almendras (San Isidro) but it was no longer mentioned in the listings of 1800s.\nAfter some time, they changed the name Almendras to San Isidro after their patron Saint. San Isidro was already listed as a barrio of Concepcion in the census of 1903.'),
(29, 'San Jose (Poblacion)', 'Year of Foundation 1918,1950s \nPopulation: 8,589\nNo. of Households 2,030\nBarangay Fiesta March 18-19\nPatron Saint San Jose\n\n\n	San Jose is situated on the eastern part of Concepcion. It is the biggest and most thickly populated area in the municipality. It is considered as one of the urban barangays because of the presence of the central business district and its accessibility to all kinds of transportation.\nThe official name of barangay is San Jose, after its patron saint. Together with San Nicolas, it served as the poblacion of Concepcion for many years. Though Sa Jose was listed already as among barrios of Concepcion in the 1918 Philippine Census . it was only in recent years that it was established as an independent barrio from the other poblacion of San Nicolas\nThe early settlers in this barangay were the Aquino, Feliciano, Cortez, Lacsama, Yumul, Perez and Baluyut families.\n'),
(30, 'San Juan', 'Year of Foundation?\nPopulation: 3,057\nNo. of Households: 905\nBarangay Fiesta January 26-27\n\n\n	San Juan is the name of the western Concepcion barrio lying as the border with the town of Capas. Together with Garlit (Murcia) and Bucsit (Sta. Rosa), the barrio was a component of the defunct town of Murcia from 1888 until 1902 when the barrios were returned to Concepcion.\n'),
(31, 'San Martin', 'Other names Dalayap, Dalayat\nYear of Foundation Spanish period, already listed in 1903\nPopulation: 316\nNo/ of Households: 85\nBarangay Fiesta November 10-11\nPatron Saint San Martin de Porres\n\n\n	San Martin, after St. Martin de pores, was one of the more pronounced river settlements of Concepcion that was greatly affected by mudflows. The barrio begun as a small clearing from forested terrain of the town by a pioneer settler many years ago, Martin Yumul and his family.\n\n	Driven by the Spaniards came to date de Porres, Martin and his family decided to a permanently in this place. He begun to cultivate a portion of the land and found out the fertility of the soil with the help of his relatives and other people, the early settlement of San martin took shape. It was in this clearing of the jungle that they saw a big dalayap tree (Citrus auranrifolia, an acidic fruit [panaslam] used for ade and for flavoring food like leche flan), right in the middle of the barrios. They did not cut down this tree because of its fruits. This dalayap tree was responsible for the popular name of the barrio. Yet, it could have been Dalayat an old Kapampangan term for river bank, indicate of the geographical conditions of the barrio\nWhen the barrios of Concepcion were organized the place was given the status of a barrio, and the new name given to was San Martin named after its fundador, Martin Yumul and its patron of san Martin de Porres\nEarly tenientes del barrio included Mariana Calma, Mariano Yumul, Andres Garcia, Gabriel Yusi, Severino Mesina, Alfonso Tolentino, Atanacio Garcia, Alfredo Yumul, Tomas Yumul, Jose Malonzo, and Tranquilino Yumul.'),
(32, 'San Vicente', 'Other name/s Calius/Corba\nYear of Foundation already listed in 1903\nPopulation: 1,977\nNo. of Households: 415\nBarangay Fiesta April 3-4\n\n\n	San Vicente is the official name of the barangay, named after its patron saint, San Vicente Ferrer. It is among the oldest barrios of Concepcion, already listed in the 1903 Philippines census. San Vicente is adjacent to the barangays of San Francisco and San Nicolas Balas.\n\n	It has three main sitios, San Vicente Calius (streblus asper, also known as ampas in Kapampangan, a rigid, densely branched tree found in thickets in low and medium altitudes, especially in regions with long dry seasons), San Vicente Corba (\"curve\", in description of the road), and Masulput (proliferation of a weedy, perennial herb that grows to 50 cm tall and produces numerous light-purple flowers and green fruits in small, beanlike pods, also known as amor seco). The original site of the barangay was San Vicente Calius but with its experiences of massive flooding during the 40 days of rains in 1972 led the inhabitants to migrate to San Vicente Corba, the present center. Most of the landed domains of the barangay were owned by the Feliciano and Gueco families, especially Victor and Jesus Feliciano and Loreto and Boyong Gueco. The 1st acknowledge barangay captain was Apung Diru Lagman.\n'),
(33, 'San Nicolas Balas', 'Year of Foundation already listed in 1918\nPopulation:3,379\nNo of Households: 799\nBarangay Fiesta September 9-10\nPatron Saint San Nicolas de Tolentino\n\n\n	Way back in the year 1909, there was a group of houses in the southwestern part of the present barrio of San Nicolas Balas. This place where these houses stood was called Cajalo, the name being derived from the word halo-halo (mixed) for the people who settled there where of different customs, dialects and the like. This group of settlers came from various places. In the year 1911, the river running through this place moved away from its bed, thereby leaving a sandy texture of the soil Balas is the dialect name for sand. The name Cajalo was thus neglected or forgotten and the name balas came into existence. Among the group of families that resided there was one so influential that it owned the entire barrio. From that time on the barrio acquired its name from the Patron Saint. \"San Nicolas\" coupled with the word \"balas to become San Nicolas Balas. But traditionally, this barrio is being called Balas Pineda to distinguish the most prominent families were the Pinedas, Santos, Aguas, Tolentinos, Manalos die Leons and the Davids. In the year 1918, the people begun to govern themselves, appointing their teniente de Barrio who was Alberto Manalo who held the title of being the first barrio headman from 1913 to 1920 Fermin Aguas came second and stayed in that position from 1920 to 1931 Salvino Pineda becomes the third barrio lieutenant from 1931 to 1940. Then Gregorio Narciso was appointed in 1940 and stayed up to 1944 Miguel Pineda succeeded him and worked from 1944 to 1946. The sixth was Candido Pineda who took office from 1946 to the year 1952 and was replaced by Mr. Paulo Cunanan.\n\n	The bulk of the people now living in this barrio are tenants who work under the management of palsonoros of the big landed personages. This group of people lives in harmony from the time of planting up to the time of planting up to the time of harvest Religiously the people are most Catholics. They worship their Patron Saint \"San Nicolas\". In marriage license in the town municipal building either before the judge or parish priest. They have a godfather and godmother. The inviting of all relatives'),
(34, 'Santiago', 'Other name/s Macaualu\nYear of Foundation 1590s\nPopulation: 4,103\nNo. of Households : 1,046\nBarangay Fiesta December 29-30\nPatron Saint San Tiago (Saint James)\n\n	Santiago, officially named after its patron saint, is one of the big barrios of the town of Concepcion. It is located on the western part of the town, along the national highway leading to Capas. Macaualu was the former name of Santiago during the early years of Spanish presence in the Phillippines. It was supposed to have been named after a ferocious reptile believed that existed in the area. The nomenclature is still used for a breed of snakes that is found in the town, though it is not that rapacious as the account alleged. The prominent geographical feature of the barrio was its proximity to the Lukung (concave of hollow) River and in the olden times it was a favorite picnic site of the people. This place was mentioned in 1660 as an encampment of Melchor de Vera, the aide-de-camp of the rebel Andress Malong (of the Malong uprising fame ), with his army of 6,000 sent to invade Pampanga from the Spaniards.\n\n	The said barrio could have also been the site of the battle that ensured thereafter between the De Vera and the Spanish reconnaissance under General Francisco de Esteybar, during the administration of Governor-General Sabiniano Manrique de Lara. In the past the place was convered with thick bamboo grooves and big trees but when the people begun to migrate to this place they cleared it and built their homes. The place was then organized into a homogenous village which is now officially known as Santiago bearing the name of the Patron Saint through the common agreement of the people who organized it.\nThe first people to inhabit the place were the nomadic Zambals who came from the Zambales Mountains. They did not stay permanently in the place. The people who grew up in the village and organized it into a full fledge barrio were the Cabalu, Yumul and Bermudo families. The barrio grew up into small villages which are now known or called sitions. Among these sitions that are now within the territorial jurisdiction of Santiago are Ligaya, Yangca, Siu, Cuayan and Bilwa.\nAs far as memory can recall, the persons who served ads the head of the barrio or lieutenants are as follows: (not arranged in their chronological order) Feliciano Guttierrez, Vicente Castro, Pablo Viray, Ignacio Lacson, Marciano Estacio, Catalino Perez, Braulio Ocampo, Macario de Jesus, Jose yturralde, and Deogracias Liwanag.');
INSERT INTO `barangay_tb` (`brgy_id`, `brgy_name`, `brgy_text`) VALUES
(35, 'Santo Rosario', 'Year of Foundation 1951 \nPopulation: 946\nNo. of Households: 927\nBarangay Fiesta October 30-31\nPatron saint Our Lady of the Holy Rosary\n\n	The official name of barangay is Santo Rosario, after its patron saint, Our lady of the Holy Rosary. It used to be called Sitio Magunting of Buntuk babi, the latter in reference to Santa Monica, the matriz or mother barrio. There are many versions on the provenance of \'Magunting\' or \"scissor-shaped\", the most probable was its being the crossroad of two routes, the main road and the by-road going to Corazon de Jesus and Parulung. The name was also in reference tom its being attached to another main sitio of the barangay, Matalusad (or slippery).\n\n	It was on December 1, 1951 that the sitios of Sto. Rosario, particularly Magunting, were separated from the mother barrio of Sta. Monica. The founding teniente del barrio was then \'Tatang Buro\', or Mr. Geronimo Manuntag.\nThe first barrio fiesta, in honor of the new patron saint, was done on October 31, 1976. Almost two years later, on January 27, 1978 the said barrio of Magunting was formally changed to Sto. Rosario. Barangay Captains of the barrio from 1991-present include Marcos Manuntag, Luciano Pabalan, and. Abel Mallari.\n'),
(36, 'Santa Cruz', 'Year of Foundation 1896\nPopulation: 4,307\nNo. of Households: 1,123\nBarangay Fiesta May 2-3\nPatron Saint Holy Cross\n\n\n	Santa Cruz is the official name of the barrio. Its name was derived from a prominent landmark of the place, a crossroad, which people called Cruzada. The place was said to be a rendezvous of early revolucionarios when they attacked the town of Concepcion during the years of the Philippine Revolution. It was thus so named, adopting later the Holy Cross for its official name. Among its early sitios include Sto. Cristo, Bangcal, Cafe, Matalusad, Pao and Tacde. A number of them (Sto. Cristo, Caf, and Matalusad (Renamed as Sto. Rosario]) are now independent barangays.\nAn important historical landmark on the evolution of the area is however Tacde. At present Tacde (Kapampangan for arm, presumably because of its shape) is only a sitio of the Barrio of Sta. Cruz, situated east of the town proper. The term designated can also signify an extension or an attachment, known in Spanish times as anejo. The people of Concepcion are no longer aware that it was already existent as early as the now considered matrix of Sta. Cruz.\nThe HDP lists the Foundation of Sta. Cruz as 1896. The original settlers were the Castro, Puno, Bitagcol, Mataga, Ocampo, Montoya, and the Caguiat families.'),
(37, 'Santa Maria', 'Year of Foundation 1975\nPopulation: 4,307\nNo. of Households: 377\nBarangay Fiesta November 26-27\nPatron Saint Our Lady of the Miraculous Medal\n\n\n	The official name of the barangay is Sta. Maria. It was created in 1975 A former sitio of Pitabunan, a special abarangay election was 	held that year for the purpose. The first Barangay Captain was Mr. Ponciano Cunanan, with his councilors: Mr. Jesus Pascual, Mr. Rogelio Quiambao, Mr. Abelardo Bondoc, Mr. Gerardo Guinto and Mr. Carlos Guinto.\nThe name of the barangay was based on Our Lady of the Miraculous Medal, the patron Saint, as provided by the acknowledged founders of the barangay, Mr. Felino Garcia, Mr. Cesario Bondoc and Mr. Ponciano Cunanan.\nThe oldest settlers of the barangay include the Bondoc, Quiambao, Guinto, Pascual, and Cunanan Families.\n'),
(38, 'Santa Monica', 'Other name Buntuc Babi\nYear of Foundation 1895 \nPopulation: 5,625\nNo. of Households: 1,356\nBarangay Fiesta May 3-4\nPatron Saint St. Monica\n\n	Sta. Monica is the official name of the barangay. It is situated in the eastern part of Concepcion. Rich in its natural resources, especially its vast agricultural lands, it is also noted for its fishing grounds and its native industries of mats and hats. Culatigan was the first name of the barrio when it was still located along the bank of the Chico River crossing the Culatigan Creek. Its transfer to its present place was due to the fear of the Spaniards of the people collaborating with the Katipuneros. That was about the time when General Mariano Llanera was organizing his revolutionary army in Nueva Ecija.\nA most interesting name of the barangay, and which is still being referred to, is \'Buntuc Babi (head of a boar). It was said that the place was headed once by a Negrito chieftain, a certain Capitan Lucindo. Since the area used to have wild boars, hunting was prevalent then. Each hunting party though was obligated to apportion something for the chieftain, usually the pig\'s head and was placed frequently among the house posts. Passers-by cannot help but exclaim \'Buntuc babi\' for such gory sights.\nIn 1950s, when the HDP was prepared, Sta. Monica was composed of the following sitios: Matalusad, Magunting, Tabun, Libutad, Sampaloc, Matico, Mangga and Culatingan. A number of them have attained their independent barangay status hence, including Sto. Rosario(Matalusad and Magunting) and the barangay was believed to have been to have been established in 1895.  The original settlers included the Panganiban, Ponce. and Rodriguez families. As mentioned, the first settlement was in the\nCulatrigan area, before transferring to the present site. Among the early tenientes de barrio and cabezas de barangays included Juan Ponce,  Manuel  Pafiganiban,  Angelo Pineda,  Meliton Dimatulac,\nMarciano Ponce, Felipe Arceo, Basilio Matic, Juan Matic, Basilio Simon, Olimpio mariano, Eusebio Ponce. Saturnine Pares, Crispin Mendiola,   Alejandro   Mallari,   Dalmacio  Caparas,  Deffin ysais. Demetrio Simon, Felino Sales, and Estanislao Garcia.\nIt was in 1915 that the official name of Sta. Monica was given after its patron saint, replacing that of \'Buntuc babi\'.\n\n\n'),
(39, 'Santa Rita', 'Year of Foundation 1765\nPopulation: 3,874\nNo. of Households: 1,000\nBarangay Fiesta May 21-22\nPatron Saint Santa Rita de Cascia\n\n	Sta Rita, after santa Rita de Casia, is still the present name of a populous southern barrio of Concepcion. It was then situated a la vista media hora (half-hour walk away) from the Tribunal (the town hall, in San Bartolome), as an 1842b document attested. This old barrio was said to have been established on or about May 20, 1765. At present, it is still a barrio adjacent to the town proper Concepcion.\n	Early tenientes del barrio included the following: Dalmacio Payang, Eulalio Sanchez, Santiago Manlapaz, Lucio Gonzales, Isidro Samson, Zacarias Guzman, Santiago Pineda, Jose Gutierrez, Teofilo Caliolio, and Juan Lim.\nSta. Rita had been known since the early days as a very low place, but people still continued to build their homes in spite of it. There was a time when the Parua River overflowed its banks and the onrushisng waters brought sand and silt to the barrio thereby dumping such soil almost to the floorings of the houses. The constant dumping of soil onto this low place made the barrio quite elevated thereby being made a sort of an embankment of the Parua River.\nThe original settlers of Sta. Rita included the families of Cantong Zablan, Antonio Arceo, Raymundo Tiamzon, Macario Tayag, Gracio Pineda, Apolonio Tupil, Juan Manalo, Gerardo Lampa, the Bagsic family, the Gutierrez family, and Apolonio Mallari.\nThe sitios of the barrio Sta. Rita are Coral baka and Bayabas.'),
(40, 'Santa Rosa', 'Other names Bucsit\nYear of Foundation 1590s, 1710\nPopulation: 946\nNo. of Households: 927 \nBarangay Fiesta August 29-30\n\n	This barrio is popularly known as Sta. Rosa, after its patron saint, Santa Rosa de Lima. It was known in earlier times as Bucsit. Bucsit, named after the Negritos who were the original settlers of the area, is the barrio Sta. Rosa. The account of Fr. Antonio Mozo, O.S.A (published in 1753) cited this Zamabal village (Bucsi) in May of 1702 as a site of catechism and baptism done by the Augustinian friars. 6 In Kapamoangan, bucsi is the bird\'s crop and it is used to describe people who eat voraciously or hapharzardly witout proper digestion (mamuksi). Another missionary activity cited in the are (this time as Bucsic) was in 1759, under fray ganzalo Salazar, O.S.A.\nThis old name presumably came from the early settler of the area, the record was taken, the establishment of this barrio was formally began in the year 1710, whom the founders of this barrio began to make clearings, built temporary shade for shelter and at the same time started primitive farming and domesticating wild animals. The \'kaingin\' system of clearing was used, making way for the farms. More members of the Bugnot family and relatives as well came over. Farms became wider and wider and production was abundant. In the later years the founders and the later groups who came over realized that it was worth settling permanently in said barrio, so they built a \"vista\" of their own somewhere in the center of the publication. A patron saint from Bacolod was procured by the settlers named Sta. Rosa de Lima\nIn order to bestow honor and all graces to their patron, and by popular vote of the residents of said barrio, the name of the barrio was changed from Bucsit to Sta. Rosa, its present name. The people believed that naming their barrio after their patron saint was more religious and binding among all of the barrio folks. This event happened almost after a hundred years of its establishments. Thus, in the year 1800, its former name was erased and instead, Sta. Rosa was used in honor of their patron saint.\nThe late Don Pedro Bugnot was the captain or leader of the family of founders. He headed also the long line of barrio heads. Most prominent ones to be noted here were the following: Don Pedro Bugnot or first, Placido Bugnot, the brother who succeeded him, Evaristo Manucduc, Lucerio de Ocampo, Valentin Gomez, Doreteo Lugay, Hilario Manucduc and others. Early tenientes del barrio included Don Rafael Bognot, Juan Gomez, Sr. Mariano batas, Apolinario Fausto, Juan Gomez, Jr.m Epifanio Layug, Damaso Garcia, Teodoro Layug Felipe Quiambao, Florentino Gomez, and Domingo Udiong.\nAmong the early sitios of Sta. Rosa are San Juan, Gugo, Dulong and Baug. San Juan became an independent barrio later.\n'),
(41, 'Santo Cristo ', 'Year of Foundation 1972 \nPopulation: 1,246 \nNo. of Households: 290\nBarangay Fiesta May 2-3\n\n	Barangay Sto. Cristo was craved from three conjoint barangays: malupa, San Jose and Sta. Cruz. The greater portion of this barangay was then then known as Sta. Cruz a Malati (Small Sta Cruz), in contrast to the matrix or barrio of Sta Cruz a Maragul (Bigger sta Cruz).\nIt was in 1972 that a group of its citizens filed a petition for the conversion of the said sitio into an independent barangay. The petitioners included Felix Lunasco, then the teniente del barrio, Porfirio Rivera, Marciano Felix and Servillano Domingo.\nThe petition was granted that same year, during the administration of Mayor Nicolas Feliciano, Jr. and Vice Mayor Adriano Dizon.'),
(42, 'Santo Nio', 'Year of Foundation 1750s\nPopulation: 3,907\nNo. of Households: 834\nPatron saint Santo Nio\n\n	Santo. Nio is the official name of the oldest and biggest barrios of Concepcion. It is called on the western part of the town, between the barangays of Santiago and Sta. Rosa. In earlier days, the barrio was known as Matondo. An account calls it also as Matandoc. 8lt should be Matundoc, if the etymology was from the proliferation of tundo/ tundok, or plantain (banana) tree. 9 a favorite banana species among the people of Concepcion is the La Tondan. The barrio was believed to have been founded in 1750s by the Amurao and Lindo families.\nOn account of the favorable location of Matondo, it became the site of the new town when the people abandoned San Bartolome de Magalang or \'Balen a Melacuan\'. The present poblacion of San Nicolas was a mere sitio of Sto Nio in the olden times.\nThe first inhabits to come the place were the Aetas who come from the Zambales mountains. They were driven back to their former place by the early people who came to settle in this place. The new settlers organized up the village which led to the formation of the barrio whose original families were the Lindos and the Amuraos. The barrio is composed of small villages which are now known as sitios. When the HDP was prepared in the 1950s, the sitios of Sto. Nio included San Juan, Dutung A Matas, Balaca, Cubut and Caramatan. Two of these have already attained their barangay status, San Juan and Dutung A Matas. em With the exception of San Juan and Dutung A Matas, the sitios are now depopulated. The people moved to different directions to free themselves from the approach of the dissents.\nEarly tenientes del barrio included Eugenio Lindo, Eusebio Amurao, Graciano Amurao, Teodorico Lindo, Benito Maliwat. Francisco Gomez, Fortunato delos Reyes, Teodoro Samson, Nicolas Dayrit, Roberto Bucu, Arcadio Ysais, Tomas dela Cruz, Marcelo Puri, Gregorio dela Cruz and Procto Amurao.'),
(43, 'Talimundoc Marimla', 'Year of Foundation\nPopulation: 1,685\nNo. of Households: 367\nBarangay Fiesta May 13-14\n\n	Barangay Talimundoc Marimla is in the eastern part of this municipality, as a conjunction to the provinces of Pampanga, on the east and Nueva Ecija, on the north. It is about eight kilometers from the poblacion of Concepcion.\nSince the eruption of Mt. Pinatubo the income of the people here was affected so much because their two major source of income farming and fishing were affected so much.\nTalimundoc Marimla\' (\"elevated and cool place\"), was so named because of its serene, elevated, and pristine setting.\n\n'),
(44, 'Talimundoc San Miguel', 'Year of Foundation already listed in 1903 as San Miguel \nPopulation: 2,088\nNo. of Households:  673\nBarangay Fiesta May 7-8\nPatron saint San Miguel Arcangel\n\n	Talimundoc San Miguel is the official name of the barrio. It used to be a thick forested area which original settlers were able to clear and convert into farms and residential lots. The fundadores included Mateo Yutuc, Mariano Mandal, Agapito Manayang and Mariano delos Santos. Because of its elevation, they named the area \'Talimundoc\'.\nWhen the HDP was prepared in 1950s. Talimundoc had there sitios: Talimundoc (founded 1895). Gonzales (1905) and Bayung Baryu (\'new barrio\', 1955). Sitio Gonzales was productive. Bariong Bayu or Darabulbul is a rich, fertile area for agriculture. The people who were tasked to cultive it found the area quite distant, thus motivating the landlowner, Candido Rivera, to create a sitio for them. Eraly tenientes del barrio included Macario Mandal (1895 to 1905). Landonico Ysais (1905 to 1907), Loriano Rodriguez (1907 to 1910), Matias Arceo (1910 to 1913), Fabian Sexion (1913 to 1916), Modesto Ysais (1916 to 1919), Buenaventura Manalang (1919 to 1931), Pedro Cabaligan (1931 to 1934), Julio Antonio (1934 to 1935). Nicolas Caguiat (1935 to 1937), Pedro Aliling (1937 to 1939). Tiburcio Santiano (1939 to 1941), Santiago Magcalas (1941 to 1942), Anselmo Santiano (1942 to 1943), Mariano dela Cruz (1943 to 1944). Arsenio Salonga (1944). Raymundo Calara (1944, Anselmo Santiago (1945 to 1946) and Agustin Cano (1946 to 1953).\n'),
(45, 'Telabanca', 'Other names Mabuloc\nYear of Foundation already listed in 1903\nPopulation: 941\nNo. of Households: 234\nBarangay Fiesta: August 14-15\nPatron saint San Roque\n\n	The present official name of the barrio is Telabanca. Like many other places in the Philippines, Telabanca has undergone so many names. Founded by Feliciano. Pineda and Garcia families, it was called\n\'Mabuloc\' then, which means bad or unpleasant odor in the local Kapampangan language. Because of its proximity to the Arayat Mountain, it had been the site of many skirmishes during the\nPhilippines Revolution. It was on its vicinity that victims of such activities were left to rot, many not even given proper burial. When people returned evenrtually to re-settle, the stigma and the thus the name remained for some time.\nThe prosperity and tranquility of the barrio attracted so many visitors and strangers to go this barrio from time to time for trade and oftentimes for merriments. Incidently, in their invitation in going to this\nplace, they used to say Telabanca, which literally means, \"let us ride on a boat\". This word became so familiar and popular that the barrio folks later decided to change the name of the barrio from Mabuloc to Telabanca which now bears the official name of the barrio.\nThe place was already listed as barrio of Concepcion in the Philippine Census of 1901, with 785 inhabitants. Among the early tenientes del barrio included Alfonso Pineda, Francisco Garcia, Amado Marimla. Alberto Lpez, Marcelo Ocampo, and Alberto Salas.\nThe barrio was greatly affected with the Pinatubo eruption in 1991 and its afttermath.'),
(46, 'Tinang', 'Year of Foundation ca. 1853, 1934, 1950s\nPopulation: 3,939\nNo. of Households: 1,078\nBarangay Fiesta November 26-27\n\n	The official name of the barangay is Tinang. In early days, according to the HDP, Tinang was not known as it is today. It was just called \"Caingin Aleman.\"\nCaingin Aleman, as it was then known, was full of gigantic and thick forest. Monkeys, wild animals and many game birds bound. Since it was an excellent place for habitation inasmuch as there was water supply and other amenities, hunters built temporary huts to pass away the time with no attention of settling there permanently. But luckily a German soon found the place very excellent, so he secured for himself the necessary papers for a homestead. He was able to get them. The German attracted the hunters by giving them excellent nets and lent them his ferocious hunting dogs. The intention the German was to utilize the potentialities of the human resources which were coming in plenty. The place was soon cleared and much vegetation was soon ready for harvest. People from the neighborhood came in to abandon their hunting and settle there permanently.\nA few years after, a village was formed and known as \"Caingin Aleman.\" But this German had a very beautiful wife and her beauty bespeaks of her kindness and understanding towards their workers. Her name was Maria Cristina. No wail of distress from any sick man in the place was turned to by a deaf ear. All were contented and happy. The people around called her \"Indang Tinang.\"\nSoon the kind lady bade them farewell. The people mourned for the loss of a very understanding elder. From that time on, place was called Tinang.\nAn old document attests however that it is not so since a barrio of the same appellation was already in existence as early as 1853 in the former town of Magalang-Concepcion. It only reappeared however in the 1934, as part of the San Miguel Barrios that also included Talimundoc, Corazon de Jesus (Darabulbul), Mabilog and Pitabunan.\n');

